import React from "react";
import Skill from "./skill";
import "../res/skills.css"


function skills(){
    return(
        <section id="Skills">
            <br />
            <br />
            <h1 class="option3">Skills</h1>
            <br/>
            <br/>
            <Skill />
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
        </section>
    );
}

export default skills;
